  \"2015-05-14T04:23:24.536653\",\n\t\"name\": \"marylands-third-order-12-digit-watersheds\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This is statewide digital watershed data.
  It was created primarily for state and federal agency use. The watersheds define
  Strahler (Strahler 1952 p. 1120) third order stream drainage by contours on U.S.
  Geological Survey 7.5 minute quadrangle map sheets. Some watershed drainage areas
  were defined for streams less than third order and some large area watershed were
  split to maintain a maximum size of 15,000 acres. The watershed boundaries in this
  file were developed in a joint state and federal effort to create a consistent watershed
  file for use by all government agencies with an interest in Maryland's watersheds.
  The U.S. Natural Resources Conservation Service (NRCS) redefined the third order
  watersheds creating the HUA14 file. This file contains all of the HUA14 watersheds
  and some added watersheds to maintain water quality sampling sites. It was also
  used to create the Maryland Sub-Watershed file.\",\n\t\"license_title\": \"License
